class Submission:
    def __init__(self, user_id, data):
        self.user_id = user_id
        self.data = data
        self.errors = []
        self.is_valid = False

    def validate(self):
        self.errors.clear()
        if not self.data.get('title'):
            self.errors.append("Title is required.")
        if not self.data.get('description'):
            self.errors.append("Description is required.")
        if len(self.data.get('description', '')) < 10:
            self.errors.append("Description must be at least 10 characters long.")
        self.is_valid = len(self.errors) == 0

class SubmissionManager:
    def __init__(self):
        self.submissions = []
        self.validation_rules = {
            "title": {"required": True},
            "description": {"required": True, "min_length": 10},
        }
        self.logs = []

    def submit(self, submission):
        submission.validate()
        if submission.is_valid:
            self.submissions.append(submission)
            self.log_submission(submission)
        else:
            return submission.errors

    def log_submission(self, submission):
        log_entry = {
            "user_id": submission.user_id,
            "data": submission.data,
            "errors": submission.errors,
        }
        self.logs.append(log_entry)

    def update_validation_rules(self, rules):
        self.validation_rules.update(rules)

    def load_historical_data(self, data):
        for entry in data:
            submission = Submission(entry['user_id'], entry['data'])
            self.submit(submission)

# Example use case
submission_manager = SubmissionManager()

# User submits a record
user_submission = Submission(user_id=1, data={'title': 'Test Title', 'description': 'Short'})
errors = submission_manager.submit(user_submission)

if errors:
    print("Submission errors:", errors)
else:
    print("Submission successful.")

# Developer updates validation rules
submission_manager.update_validation_rules({"description": {"min_length": 5}})

# Load historical data
historical_data = [
    {'user_id': 2, 'data': {'title': 'Old Title', 'description': 'Old description'}},
    {'user_id': 3, 'data': {'title': '', 'description': 'No title'}}
]
submission_manager.load_historical_data(historical_data)

# Check logs
print("Submission logs:", submission_manager.logs)
